// components/Header.js
import React,{useContext} from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import TokenContext from './TokenContext';
import '../css/Header.css';

const Header = () => {
    const navigate = useNavigate();
    const { logout, isLoggedIn } = useContext(TokenContext);


    const handleLogout = async() => {
      await logout();
      navigate("/")
    };

    return (
        <Navbar className="navbar-custom" expand="lg">
            <Container>
                <Navbar.Brand className="navbar-brand-custom" onClick={() => navigate('/')}>Nutritracker</Navbar.Brand>
                {isLoggedIn && ( <>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link className="nav-link-custom" onClick={() => navigate('/')}>Home</Nav.Link>
                        <Nav.Link className="nav-link-custom" onClick={() => navigate('/search')}>Add Food Log</Nav.Link>
                        <Nav.Link className="nav-link-custom" onClick={() => navigate('/addCustomFood')}>Add Custom Foods</Nav.Link>
                    </Nav>
                    <Nav>
                        <NavDropdown className="nav-dropdown-custom" title="Profile" id="basic-nav-dropdown">
                            <NavDropdown.Item className="dropdown-item-custom" onClick={() => navigate('/profile')}>Profile</NavDropdown.Item>
                            <NavDropdown.Item className="dropdown-item-custom" onClick={handleLogout}>Logout</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                </Navbar.Collapse>
                </>
                )}
            </Container>
        </Navbar>
    );
};

export default Header;
